import React from 'react';
import mySvg from '../PalladioGraphV2.svg';

const ProjetData = () => {
    return (
      <div style={{ width: '100%', height: 'auto' }}>
        <h4>Les jeux vidéos et leur présence sur les différentes plateformes.</h4>
        <img src={mySvg} alt="Mon SVG"/>
      </div>
    );
  }  

export default ProjetData;
